description:
In deze compleet nieuwe verzameling kerstverhalen vind je uit wie stout is geweest en wie zoet. De kerstman, Mickey Mouse en al zijn Disney vriendjes schitteren in een originele film over hoe belangrijk het is om je hart open te stellen voor de echte kerstgedachte. 

Kijk hoe koppige Donald wanhopige pogingen doet om vooral niet van de kerstdagen te genieten. lach vervolgens mee met Mickey en Pluto als ze een belangrijke les leren over de kracht van vriendschap. Deze magische CGI animatie geeft jou en je familie een geheel nieuwe kijk op je favoriete Disney vriendjes 

